import React from 'react'
import {makeStyles} from '@material-ui/core/styles'
import {Container, Typography, Tab, Tabs, Grid, Paper} from '@material-ui/core'
import ProjectCard from './ProjectCard'

const useStyles = makeStyles(theme => ({
  root: {
    background: theme.palette.type === "light" ? "green" : theme.palette.background.dark,
    padding: theme.spacing(2),
    marginBottom: theme.spacing(10)
  },
  MuiTabsFlexContainer: {
    centered: true,
    variant: 'fullWidth'
  }
}))



function Projects() {
  const classes = useStyles()
  const [currentTab, setCurrentTab] = React.useState(0)

  return (
    // <Container justify="center" maxWidth={false} align="center" className={classes.root} id="projects">
    <Paper id="projects">
      <Typography variant="h3" align="center"style={{textDecoration: "underline"}}>Projects</Typography>
      <Tabs value={currentTab} centered variant='standard' onChange={(e, value) => setCurrentTab(value)}>
        <Tab label="All" />
        <Tab label="React" />
        <Tab label="Django" />
        <Tab label="java" />
      </Tabs>
      <Grid container justify="center">
        <ProjectCard />
        <ProjectCard />
        <ProjectCard />
        <ProjectCard />
      </Grid>
    </Paper>
    // </Container>
  )
}

export default Projects
